import axios from 'axios';
import ReactDOM from 'react-dom';
export default function blarghfoo() {
    function makerequest() {
        axios.get("/api/getmqtt_messung/56").then(response => {
            console.log(response)
            var messung = response.data.messung;

            ReactDOM.createRoot(document.getElementById("testblargh")).render(<h1>Verbrauch von Geraet 56: {messung}</h1>)

        })
    }
    makerequest()
    return (
        <>
            <h1>TestUeberschrift</h1>
            <div id="testblargh"></div>
        </>
    )
}
